import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';

function Sitename()
{
	const headerstyle = {
		position: "absolute",
		left: "600px",
		top: "45px",
		fontFamily: "Candara",
		fontStyle: "italic",
		fontSize: "95px",
		textAlign: "center",
		color: "white"
	};
	
	return <p style={headerstyle}> Treebase </p>;
}

